content:
@everyone So! On the 16th of November, ACM will be hosting our first Hackathon in EGR214 from 10:00 A.M. to 7:00 P.M. The objective of this event is to hack into a designated 3D printer and print something. Even if you have absolutely no knowledge of hacking (or programming), you can still learn a lot!  We will provide consumables (both food and drink) so that your hacking capabilities are fully optimized, as well as hints and explanations if you get stuck and need help. The objective of this event is to raise awareness of the need for security, so with that being said, at the end of the event I will be going over 3 different ways to Hack into the 3D printer with a detailed explanation of the steps. Additionally, if you consider yourself a Try-Hard, you can enter into the competitive side of the event and get the chance to win a free Raspberry Pi!!! So whether you grab a group of friends, or tackle the event solo, be prepared for a full day of Hacking!

If you would like to come, please sign up using this form!
https://docs.google.com/forms/d/e/1FAIpQLSeuvcrZnD0MKUparvkdEw0btYwnwEBWLc52jrr7173ohdevqg/viewform?usp=sf_link
